import { useNavigate } from "react-router-dom";

function NextPage() {
    const navigate = useNavigate();

  const goBack = () => {
    navigate('/Main');
  } 
  return (
    <div className="App">
      <button onClick={goBack}>goBack</button>
    </div>
  );
}

export default NextPage;
